import { Link } from 'react-router-dom';

export default function Menu() {
    return (
        <div className='menu'>
            <div className='menu_container'>
                <Link to="/todo"><button>Todo</button></Link>
                <Link to="/timer"><button>Timer</button></Link>
            </div>
        </div>
    );
}
